  `amount` int DEFAULT NULL,
  `period` int DEFAULT NULL,
  `first_loan` tinyint(1) DEFAULT '0',
  `sent_1c` tinyint(1) DEFAULT '0',
  `payment_schedule` json DEFAULT NULL,
