  `branche_id` int DEFAULT NULL,
  `probably_return_date` datetime DEFAULT NULL,
  `probably_return_sum` int DEFAULT NULL,
  `psk` float DEFAULT NULL,
  `reject_reason` text,
  `reason_id` int DEFAULT NULL,
  `utm_source` varchar(30) DEFAULT NULL,
  `utm_medium` varchar(30) DEFAULT NULL,
  `utm_campaign` varchar(30) DEFAULT NULL,
  `utm_content` varchar(30) DEFAULT NULL,
  `utm_term` varchar(30) DEFAULT NULL,
  `webmaster_id` varchar(30) DEFAULT NULL,
  `click_hash` varchar(70) DEFAULT NULL,
  `juicescore_session_id` varchar(255) DEFAULT NULL,
  `local_time` varchar(20) DEFAULT NULL,
  `autoretry` tinyint(1) DEFAULT '0',
  `autoretry_result` varchar(255) DEFAULT NULL,
  `autoretry_summ` int DEFAULT '0',
  `nocallme` tinyint(1) DEFAULT '0',
  `accept_date` datetime DEFAULT NULL,
