  `approve_date` datetime DEFAULT NULL,
  `confirm_date` datetime DEFAULT NULL,
  `client_status` varchar(5) DEFAULT NULL,
  `antirazgon` tinyint(1) DEFAULT '0',
  `antirazgon_date` datetime DEFAULT NULL,
