  KEY `click_hash` (`click_hash`),
  KEY `reason_id` (`reason_id`),
  KEY `client_status` (`client_status`),
  KEY `offline` (`offline`),
  KEY `quality_workout` (`quality_workout`),
  KEY `penalty_date` (`penalty_date`),
  KEY `organization_id` (`organization_id`),
  KEY `employer` (`employer`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3;


DROP TABLE IF EXISTS `s_organization_settlements`;
CREATE TABLE `s_organization_settlements` (
  `id` int NOT NULL AUTO_INCREMENT,
  `name` varchar(255) NOT NULL,
  `bik` varchar(255) NOT NULL,
